import React from 'react';

function Dashboard({ user }) {
  return (
    <div className="container">
      <h2 className="mb-4">Chào mừng {user.name} ({user.role})</h2>
      <p>Dưới đây là các dịch vụ bạn có thể truy cập:</p>
      <ul>
        <li>✔ Web Development</li>
        <li>✔ Mobile App Development</li>
        <li>✔ UI/UX Design</li>
        <li>✔ Backend API</li>
      </ul>
    </div>
  );
}

export default Dashboard;
